import React from "react";
import './style.css';
import { Link } from 'react-router-dom'

export function ReviewPage({
    history,
    match,
}) {

    function getApplication() {
        return axios.get(`http://localhost:5001/api/apps/${match.params.id}`)
    }

    React.useEffect(() => {
        getApplication().then(data => {
            console.log(data)
        }).catch(err => {
            console.log(err)
        })
    })

    return (
        <body>
            <h2>Review</h2>
        </body>
    )
}
